import { ADD_FAV } from '../actions-types/actions-types'

const initialState = ({
                        myFavorites:[],
                        })

const reducer =(state = initialState, action) =>{
    switch(action.type){
        case ADD_FAV:
            return{
                ...state,

            }
        default: return {
            ...state
        }
    }
}

export default reducer
